import './Banners.css';

function Banners() {
  return (
    <div className="Banners">
        <ul>
            <li><h1>KUIKA @WORLD PADEL TOUR</h1></li>
            <li> <h1>BRUSSELS OPEN</h1></li>
            <li> <p>Le top du Padel mondial s'apprête à enflammer Bruxelles</p></li>
        </ul>
    </div>
  );
}

export default Banners;
